text:
#toyota #echo conclusion post. this was a fun one that got stressful lol. these are the the videos i got, i might do last one post with pictures. these in progress posts are stressful because i have no answer yet, but i really like how it gets some of you guys engaged, questioning and suggesting stuff. please feel free to do so, makes the job more exciting. i may never know why cyl 2/3/ or 4 injectors affected a completely separate and shielded circuit, but a crank sensor fixed this car. last video is the confirmation this cold morning, but viewing the charged waveform was evidence enough.
fix: new ‚Äúupdated‚Äù crank sensor 
